import InputField from '../InputField/InputField';
import './form.css';
const input_data =[
  {
    type:"text",
    placeholder:"First Name",
    name:"firstname",
    label:"First Name",
    required:"*"
  },
  {
    type:"text",
    placeholder:"Middle Name",
    name:"fname",
    label:"First Name",
  },
  {
    type:"text",
    placeholder:"Last Name",
    name:"lastname",
    label:"Last Name",
    required:"*"
  },
  {
    type:"date",
    placeholder:"Date Of Birth",
    name:"dob",
    label:"Date Of Birth",
    required:"*"
  },
  {
    type:"number",
    placeholder:"Contact No.",
    name:"contactnumber",
    label:"Contact No.",
    required:"*"
  },
  {
    type:"text",
    placeholder:"Address ...",
    name:"contactnumber",
    label:"Parmanent Address",
    required:"*"
  }

];
const Form =()=>{
return(
    <form action="" >
   <div className="form-group">
    <div className="form_title">
      <h3>Registration Form</h3>
    </div>
     <div className="row">
     {
      input_data.map((data)=>{
      return <h1>{data}</h1>
      })
     }
    <InputField  type ="text" />
     </div>
   </div>
  </form>
);
}
export default Form;
